import React from 'react';
import { FontAwesomeIcon } from '@fortawesome/react-fontawesome'
import {faCalendarAlt} from '@fortawesome/free-solid-svg-icons'

export default function Novedad(props) {
    const img = props.novedadInfo.img;
    const titulo = props.novedadInfo.titulo;
    const fecha = props.novedadInfo.fecha;
    const texto = props.novedadInfo.texto

    return(
        <div class="post-slide">
            <ul class="post-info">
                <li><FontAwesomeIcon icon={faCalendarAlt}/>{fecha}</li>
            </ul>
            <div class="post-img">
                <img src={img} alt=""/>
            </div>
            <div class="post-content">
                <h3 class="post-title">{titulo}</h3>
                <p class="post-description">{texto}</p>
            </div>
        </div>
    )
}
